import{Routes,Route}from 'react-router-dom';
import'./App.css';
function App(){
  return(
    <Routes>
      <Route path="/"element={<Home/>}></Route>
      <Route path="/about"element={<About/>}></Route>
    </Routes>
  )
}
export default App;
